                return ':seven:'
                break;
            case "8":
                return ':eight:'
                break;
            case "9":
                return ':nine:'
                break;
            case "!":
                return ':grey_exclamation:'
                break;
            case "<":
                return ':arrow_backward:'
                break;
            case ">":
                return ':arrow_forward:'
                break;
            case ",":
                return ','
                break;
            case ".":
                return '.'
                break;
            case "@":
                return '@'
                break;
            default:
                return ' ' 
                break;
        }
    }	
}
